import React from 'react';
import axios from 'axios';

import './App.css';

class App extends React.Component {

  componentDidMount() {
    axios.get(`http://127.0.0.1:8001/api/products`)
      .then(res => {
        const persons = res.data;
        console.log(persons);
        this.setState({ persons });
      })
  }

  render() {
    return <div>test</div>;
  }
}

export default App;
